    np=base;
    for(i=60;i>=0;i--){
      c=0;
      for(j=0;j<n;j++){
        //領域の始点、三角形の最下y座標の低いほうを起点に
        //ある点から右か右斜め上に広げるイメージ
        hs=llmin(y[j],np);
        w=(hs-base)%3;
        l=cval-x[j]-y[j];
        //[三角形の最下点,領域の終点]
        rgdigdp(l,y[j]-hs,np+(1ll<<i)-1-hs,get);
        c+=get[(3+bm-w)%3];
        c%=2;
      }
      //printf("%lld:%lld\n",i,np);
      if(c==0){
        np+=(1ll<<i);
      }
    }
    by=np;bx=cval-by;
    if(findcol(bx,by)==0){
      printf("<%lld %lld>\n",bx,by);
      return -1;
    }
    lx=bx;
    hx=bx;
    for(i=60;i>=0;i--){
      w=(1ll<<i);
      if(findcol(lx-w,cval-(lx-w))==1){
        lx-=w;
      }
      if(findcol(hx+w,cval-(hx+w))==1){
        hx+=w;
      }
    }
    printf("%lld %lld\n",lx,cval-hx);
    return 0;
